'use strict';

const express = require('express');

// Constants
const PORT = 8080;
const HOST = '0.0.0.0';
let first = true;
// App
const app = express();
app.get('/', (req, res) => {
   let statusCode = 200;
   if(first){
        first = false;
        statusCode = 202;
    }


    let n = req.query.n || 0;
  var stringv = ""

    if (n==0){
    	stringv = '';
    }
    else if (n==32){
    	stringv = ''
    }
    else if (n==64){
    	stringv = ''
    }
    else if (n==96){
    	stringv = ''
    }
    else if (n==128){
    	stringv = ''
   	}
   	else if (n==160){
    	stringv = ''
   	}
   	else if (n==192){
    	stringv = ''
   	}
   	else if (n==224){
    	stringv = ''
   	}
   	else if (n=256){
   		stringv = ''
   	}

   res.status(statusCode)
   res.send(stringv)
});

app.listen(PORT, HOST);
console.log(`Running on http://${HOST}:${PORT}`);
